import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/styles';
import { Map as LeafletMap, TileLayer, Popup, CircleMarker, GeoJSON, Tooltip, FeatureGroup, LayersControl } from 'react-leaflet';
import {Link } from 'react-router-dom';
import {Card, CardContent, CardHeader, Divider} from '@material-ui/core';
import { useEffect, useState } from 'react';
import FullscreenControl from 'react-leaflet-fullscreen';
import 'react-leaflet-fullscreen/dist/styles.css';
import { ShapeFile } from "react-leaflet-shapefile"

const useStyles = makeStyles(theme => ({
  root: {
    height: '100%'
  },
  content: {
    alignItems: 'center',
    display: 'flex'
  },
  title: {
    fontWeight: 700
  },
  avatar: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.primary.contrastText,
    height: 56,
    width: 56
  },
  icon: {
    height: 32,
    width: 32
  },
  progress: {
    marginTop: theme.spacing(3)
  }
}));
const { BaseLayer, Overlay } = LayersControl;

const Map = props => {
  const { className, ...rest } = props;

  const classes = useStyles();

  const [contacts,setContacts ] = useState([]);

  useEffect(() => {
    fetch('https://analytcs-bknd-service-dot-airqo-250220.uc.r.appspot.com/api/v1/dashboard/monitoringsites?organisation_name=KCCA')
    //fetch('http://127.0.0.1:5000/api/v1/dashboard/monitoringsites?organisation_name=KCCA')
      .then(res => res.json())
      .then((contactData) => {
        setContacts(contactData.airquality_monitoring_sites)
      })
      .catch(console.log)
  },[]);

  let getColor = (aqi) =>{
    return aqi > 250.4  ? '#81202e' :
      aqi > 150.4  ? '#8639c0' :
        aqi > 55.4   ? '#fe0023' :
          aqi > 35.4   ? '#ee8327' :
            aqi > 12   ? '#f8fe39' :
              aqi > 0   ? '#44e527' :
                '#808080';
  }

  //my additions
  /*var file = require('./Shapefiles.zip');
  var reader = new FileReader();
  var geodata = reader.readAsArrayBuffer(file)
  
  
  function onEachFeature(feature, layer) {
				if (feature.properties) {
					layer.bindPopup(Object.keys(feature.properties).map(function(k) {
						return k + ": " + feature.properties[k];
					}).join("<br />"), {
						maxHeight: 200
					});
				}
      }
      
  let ShapeLayers = (<Overlay checked name='Feature group'>
      <FeatureGroup color='purple'>
        <ShapeFile data={geodata} onEachFeature={this.onEachFeature} isArrayBufer={true}/>
        </FeatureGroup>
        </Overlay>);*/
        
      

  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
    >
      <CardHeader        
        title="Mean PM2.5 by Location for Past 60 Minutes"
      />
      <Divider />
            
      <CardContent>
        <LeafletMap
          animate
          attributionControl
          center={[0.3341424,32.5600613]}
          doubleClickZoom
          dragging
          easeLinearity={0.35}
          scrollWheelZoom
          zoom={12}
          // maxZoom={20}
          
          zoomControl        
          
        >
          <TileLayer
            url="http://{s}.tile.osm.org/{z}/{x}/{y}.png"
          />  
          <GeoJSON 
          data={getGeoJsonKampala()}
          style={() => ({
            color: '#4a83ec',
            weight: 0.5,
            fillColor: "#1a1d62",
            fillOpacity: 1,
          })}
           />
          {/*<GeoJSON data={getGeoJsonGreaterKampala()} />*/}

          
        
        
          {contacts.map((contact) => (
            <CircleMarker 
              center={[contact.Latitude,contact.Longitude]}
              color={getColor(contact.Last_Hour_PM25_Value == 0?'':contact.Last_Hour_PM25_Value)}
              fill="true"
              key={contact._id} 
              clickable="true"           
              radius={16}
              fillOpacity={1}
            >
              <Tooltip 
                direction='center' 
                offset={[-8, -2]} 
                opacity={1} 
                permanent 
                className='markertext'
              >
                <span>{contact.Last_Hour_PM25_Value == 0?'':contact.Last_Hour_PM25_Value}</span>
              </Tooltip>
              <Popup>
                <h2>{contact.Parish} - {contact.Division} Division</h2> 
                <h4>{contact.LocationCode}</h4>

                <h1> {contact.Last_Hour_PM25_Value == 0?'':contact.Last_Hour_PM25_Value}</h1> 
                <span>Last Refreshed: {contact.LastHour} (UTC)</span>
                <Divider/>

                
               
                <Link to="/graph/4">More Details</Link>
                
              </Popup>
            </CircleMarker>         
          ))}          

          <FullscreenControl position="topright" />
        </LeafletMap>
        
      </CardContent>

    </Card>

  );
};

